import React from 'react'
import './DanceTourCard.css'

function DanceTourCard(props) {
  return (
    <>
        {/* <div> */}
            <div class="card col-md-3 text-white" id='dancetour-card'>
                <img src={props.image} class="card-img-top" id='card-img' alt="..." />
                <div class="card-body text-center bg-dark" id='card-bottom'>
                    <h5 class="card-title text-uppercase">{props.title}</h5>
                    <p class="card-text">{props.text}</p>
                </div>
            </div>
        {/* </div> */}
    </>
  )
}

export default DanceTourCard
